import React from "react";
import classes from "./Cell.module.css";
import { TETROMINOS } from "../../tetrominos";

const Cell = (props) => (
  <div className={classes.Cell} type={"L"} color={TETROMINOS["L"].color}>
    cell
  </div>
);

export default Cell;
